      - connector: "attach"
        dockerTemplateBase:
          capabilitiesToAdd:
          - "NET_ADMIN"
          - "NET_RAW"
          capabilitiesToAddString: |-
            NET_ADMIN
            NET_RAW
          cpuPeriod: 0
          cpuQuota: 0
          image: "ubuntu-agent:latest"
        labelString: "ubuntu-agent"
        name: "ubuntu"
        pullStrategy: PULL_NEVER
        pullTimeout: 300
        remoteFs: "/jenkins-workspace"
        removeVolumes: true
      - connector: "attach"
        dockerTemplateBase:
          cpuPeriod: 0
          cpuQuota: 0
          image: "rhel-agent:latest"
          privileged: true
        labelString: "rhel-agent"
        mode: EXCLUSIVE
        name: "rhel"
